import APIService from '../APIService';
import React, {useState, useEffect} from 'react'

function WorkoutList(props) {

    const [new_workout, setNewworkout] = useState('')
    const [exercise_list, setExerciselist] = useState('')

    const editBtn = (workout) =>{
        props.editBtn(workout)
    }
    console.log(props.workouts)
    useEffect(() => {
        props.workouts.map(workout => {
            fetch(`http://127.0.0.1:8000/active/${workout.id}`, {
            'method':'GET',
            headers: {
                'Content-Type':'application/json',
            }
            })
            .then(resp => resp.json())
            .then(resp => console.log("test wydruku",resp, workout.id))
            .then(resp => setExerciselist(resp))
            .catch(error => console.log(error))
        })        
      }, [])
        // let zipped = props.workouts.map((x, i) => [x, exercise_list[i]]);

    return (
        <div className="WorkoutList">
            { exercise_list && exercise_list.map(el => {
                    return (

                        <div key= {el.id}>
                            <h2>TESOWANIE </h2>
                            <h3>{el.exercise}</h3>
                        </div>
                 )
            })
        }</div>

    )
}

WorkoutList.propTypes = {
    // workouts: []
}

export default WorkoutList
